        String s1 = "egg";
        String t1 = "odd";
        System.out.println(isIsomorphic(s1, t1));
        String s2 = "egg";
        String t2 = "oid";
        System.out.println(isIsomorphic(s2, t2));
        String s3 = "title";
        String t3 = "paper";
